import styled from 'styled-components'

const formDiv = styled.form `
    width: 705px;
    height: 425px;
    background: #FFFFFF;
    box-shadow: 4px 10px 4px rgba(0, 0, 0, 0.25);
    border-radius: 50px;
`

const labelForm = styled.label `
    font-family: Roboto;
    font-style: normal;
    font-weight: normal;
    font-size: 24px;
    line-height: 28px;
    color: #000000;
`

const inputForm = styled.input `
    background: #FFFFFF;
    border: 0.5px solid rgba(0, 0, 0, 0.1);
    box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
    border-radius: 10px;
`

const titleForm = styled.label `
    font-family: Montserrat;
    font-style: normal;
    font-weight: bold;
    font-size: 40px;
    line-height: 49px;
    /* identical to box height *
    color: #000000;
`

export default function Home () {
    return (
        <div style={{ display: 'bloc', height: '100vh'}}>
            <div style={{ backgroundColor: '#0D79CA', height: '50vh'}}>
                
            </div>
            <div style={{ backgroundColor: '#EEF2F6', height: '50vh'}}>
            <formDiv>
                <titleForm>Connexion</titleForm>
                <div>
                    <labelForm>Nom d'utilisateur</labelForm>
                    <br/>
                    <input type='text' name="username" placeholder=""/>
                </div>
                <div>
                    <labelForm>Mot de passe</labelForm>
                    <br/>
                    <input type='password' name="password" placeholder=""/>
                </div>
            </formDiv>
                
            </div>
        </div>
    );
}
